import React, { Component } from 'react';

class HeroSection extends Component{
    render(){
        return(
            <div className="container">
                <div className="row">
                    <div className="col">
                        <div className="jumbotron">
                            <h1>It is hero's section.</h1>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default HeroSection;
